import React from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';
const Shelf = (props) => {

  return (
    <Card className='shelf'>
      {props.items && props.items.map((planogram,index) => (
        <Facing 
          productUPC={planogram[index].productUPC} 
          facingID={planogram[index].facingID}
          // shelfID={planogram.shelfID}
          // gondolaID={planogram.gondolaID}
        />
      ))}

    </Card>

  );
};

export default Shelf;
